        >
          Learn React
        </a>
      </header> */}
      <HeaderHome/>
      <Router>
        <Routes>
          {
            ["/", "/home"].map((path, index)=>
              <Route key={ index} path={path} element={<Home/>}/>
            )
          }
        </Routes>
      </Router>


    </div>
  );
}

export default App;
